import React from 'react';
import Nav from './Nav';
import Resume from './Resume';
import './App.css';
import { Router } from 'react-router-dom'

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Nav />
        <Router path='/resume' render={() => <Resume />} />
      </header>
    </div>
  );
}

export default App;
